export default function SeatMap({ seats }) {
  if (seats.length === 0) return null;

  return (
    <div>
      <h2>Seats</h2>
      <div style={{ display: "flex", gap: "10px", flexWrap: "wrap" }}>
        {seats.map((s) => (
          <div
            key={s.id}
            style={{
              padding: "10px",
              backgroundColor: s.is_booked ? "#f44336" : "#4caf50",
              color: "white",
              borderRadius: "4px",
            }}
          >
            {s.seat_number}
          </div>
        ))}
      </div>
    </div>
  );
}
